    "2016-04-19T02:27:58.523910",nt"name": "electric-vehicle-charging-network",nt"isopen":
    false,nt"url": null,nt"notes": "Austin Energy operates the Plug-In EVerywhereu2122
    network of plug-in electric vehicle charging stations located at sites throughout
    the service territory. Some stations are located at City of Austin facilities. The
    Plug-In EVerywhereu2122 network is the first in the U.S. to be completely powered
    by renewable energy via the GreenChoiceu00ae program. The initial network of 113
    stations successfully fulfills Austin's commitment to the ChargePoint America program
    that selected Austin as one of only nine metropolitan regions in the country to
    participate in the federal stimulus grant funded program. Austin Energy is now working
    with its customers to connect privately-owned stations at workplaces, multi-family
    residences, and retail outlets to the Plug-In Everywhereu2122 network. The public-access
    charging stations provide both Level 1 (110 volts) and Level 2 (220/240 volts) charging
    capability and are geographically distributed throughout Austin. They are available
    for use by anyone with a plug-in electric vehicle. Austin Energy offers a $25 six-month
    subscription membership for unlimited charging at any public-access network location.
    Or, credit cards can be used for $2 per hour of plugging in.",nt"license_title":
